const styles = theme => ({
    titlePaper: {
        marginTop: theme.spacing(3),
        width: '50vw',
    },
    title: {
        margin: theme.spacing(2),
        width: '40vw',
        inputProps: {
            font: 20,
        }
    },
    saveButton: {
        flexGrow: "1",
    },
});

export default styles;
